const Login = () => {

    return (
        <>
        <div className="conatiner">
            
            <div className="card">
                <input type="email" className="form-control" value="" placeholder="enter email" />
                <input type="password" className="form-control" placeholder="password"/>
            </div>
        </div>
        </>
    )
}

export default Login;
